        System.out.println("Modelo: "+ this.modelo);
        System.out.println("Km: "+ this.km);
        System.out.println("Valor Fipe: "+ this.valorFipe);
        System.out.println("Valor Venda: "+ this.valorVenda);
    }
    
    
}

